import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom";
import form from "./Pages/form";
function App() {
  return (

      <BrowserRouter>
        <Routes>
          <Route path="/" exact element={form} />
        </Routes>
      </BrowserRouter>

  );
}

export default App;
